const spirit =
	"image://data:image/png;base64,";


const idle_phone =
  "image://data:image/png;base64,"
const wake_phone =
  "image://data:image/png;base64,"

const years = ["root", "pamir", "rose", "xxx"];

// 연도별 현재값(분자)
const current = [3, 1, 2, 2];
// 연도별 최대값/총심볼(분모) — 연도마다 다르게!
const totals = [5, 1, 3, 2];

// const symbolSize = 50;
const symbolSize = '100%';
// const symbolMargin = "5%";
const symbolMargin = 0;
const rowGap = 8;
const MAX = Math.max(...totals);
// 공통 옵션
const baseOption = {
	tooltip: {},
	min: 0,
	max: MAX,
	interval: 1,
 	// splitNumber: MAX,
  // splitLine: { show: true },
// 	axisLine: { lineStyle: { color: '#999' } },
  // axisLabel: { margin: 10 },
	xAxis: {
		max: 10, // 툴팁/축 스케일 여유만 주면 됨
		splitLine: { show: false },
		// offset: 1,
		// axisLine: { lineStyle: { color: "#999" } },
		axisLabel: { show: false },
	},
	yAxis: {
		data: years,
		inverse: true,
		axisTick: { show: false },
		axisLine: { show: false },
		axisLabel: { margin: 10, color: "#999", fontSize: 16 },
	},
	grid: { top: "center", height: 200, left: 70, right: 100 },
	series: [],
};

// 연도별로 시리즈 2개(배경/현재) 생성
for (let i = 0; i < years.length; i++) {
	// 이 연도만 값, 나머지는 null로 비워 렌더 안 하도록
	const bgRow = Array(years.length).fill(null);
	const curRow = Array(years.length).fill(null);
	bgRow[i] = totals[i];
	curRow[i] = current[i];

	// 배경(총심볼) 시리즈
	baseOption.series.push({
		type: "pictorialBar",
		// z: 5,
		z: 20,
		symbol: idle_phone,
		symbolSize,
		symbolRepeat: totals[i],
		symbolPosition: "start",
		symbolMargin,
		// symbolOffset: [0, 0],
		animationDuration: 2,
		itemStyle: { opacity: 0.2 },
		// 이 연도의 분모(총심볼 개수 기준)
		symbolBoundingData: totals[i],
		// symbolBoundingData: max,
		data: bgRow,
	});

	// 현재(클립) 시리즈
	baseOption.series.push({
		type: "pictorialBar",
		z: 20,
		symbol: wake_phone,
		// symbolSize,
		symbolRepeat: current[i],
		symbolPosition: "start",
		symbolMargin: '100%',
		symbolClip: false,
		// symbolOffset: [-5, 0],
		// barGap: "-100%",
		symbolBoundingData: current[i],
		data: curRow,
	});
}

option = baseOption;


